import classes from './CoffeeSummary.module.css';

const CoffeeSummary = () => {
    return <section className={classes.summary}>
        <h2>
            Coffe Beans From All Around The World
        </h2>
        <p>
            Choose your favourite coffee from our wide selection of available coffee.
        </p>
    </section>
};

export default CoffeeSummary;
